INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop Gaming MSI Katana GF66 11UC 676VN','Up to 40% more performance than the previous generation. More powerful than ever with an 8-core processor, dual-core turbo clock up to 4.6GHz helps maximize performance in handling games, business software and multitasking.',0,'2021-09-12',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop Acer Aspire 3 A315 56 37DV','Powered by the latest Intel 10th Gen Ice Lake processors, a superfast SSD and a stunning Full HD display, the Acer Aspire 3 A315 56 37DV is a laptop that meets your work and entertainment needs within reach. attractive price.',0,'2021-09-12',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop Asus Vivobook A415EA EB360T','Asus VivoBook A415EA laptop owns the latest 11th generation Core i5 processor, SSD hard drive smoothly handles office and entertainment tasks. Suitable for those who are looking for a laptop that has both stable performance and a thin and light design.',0,'2021-09-12',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop gaming Acer Nitro 5 AN515 45 R3SM','Acer Nitro 5 2021 AN515 45 R3SM integrates the latest "weapons". Includes AMD Ryzen 5 5600H CPU, NVIDIA GeForce GTX 1650 VGA for powerful processing performance.',0,'2021-09-12',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Macbook Air 2020 M1 7GPU 8GB 256GB','This is the first MacBook Air and also the first Mac of Apple in the transition to ARM chip system.',0,'2020-08-20',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('MacBook Pro 13 2020 M1 16GB 256GB Z11B000CT','The Apple M1 processor makes MacBook Pro faster and more powerful than ever. Even the 16GB RAM version delivers even more impressive performance, giving you large caches and high bandwidth to comfortably multitask with absolute efficiency.',0,'2020-08-20',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop ASUS TUF Gaming F15 FX506LH HN002T','Packed with durability suitable for real-world tasks and gaming, ASUS TUF Gaming F15 FX506LI-HN039T is the Windows 10 Home gaming laptop that can help you win.',0,'2019-08-20',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop Gaming MSI GF63 Thin 10SC 468VN','MSI Gaming GF63 inherits the highly appreciated design of its predecessor. Unique gaming design with traditional black color. The MSI Dragon "red dragon" logo stands out on the case, which is machined with scratched aluminum with bold gamers.',0,'2019-08-20',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop Gaming Asus ROG Zephyrus G14 GA401QH HZ035T','Asus ROG Zephyrus G14 GA401QH HZ035T magnesium-aluminum alloy with honeycomb reinforcements keep the chassis strong and light.',0,'2018-09-30',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop Gaming Acer Predator Helios 300 PH315 54 78W5','Acer Helios laptop line has always had a design tradition with a rugged, durable, gaming-like appearance. The chassis is neat and solid with impressive bevels on the screen border as well as the body. Gives an eye-catching and impressive look.',0,'2019-08-20',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop gaming Lenovo Legion 5 15ACH6H 82JU00EXVN','The Legion 5 15ACH6H (82JU00EXVN) combines AMD 5000H and RTX 3000 CPU processing, ready for battle. Gaming laptop has super smooth 165Hz. Combined with 3D Nahimic sound that accurately identifies footsteps in space.',0,'2019-08-20',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Laptop MSI Stealth 15M A11SDK 061VN','Inspired by modern style, the new generation Stealth 15M is the thinnest and lightest 15-inch gaming laptop available in Carbon Gray and White.',0,'2018-09-30',1, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('iPhone 12','In the last months of 2020, Apple has officially introduced to users as well as iFan the new generation of iPhone 12 series with a series of breakthrough features, completely redesigned design, powerful performance and one of them. That is the iPhone 12',0,'2020-11-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('iPhone 12 Pro Max','iPhone 12 Pro Max 128 GB a super smartphone from Apple. The machine has a completely powerful performance that meets many needs from users and has a luxurious, square design.',0,'2020-11-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('iPhone 12 Pro','iPhone 12 Pro - "Super technology product" with many powerful upgrades in design, configuration and performance, affirming the trendy level in the high-end smartphone market.',0,'2020-11-30',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('iPhone 12 mini','Although iPhone 12 mini is the lowest version in the set of 4 iPhone 12 series, it still possesses outstanding advantages in terms of compact size, convenience, top performance, fast charging feature and high quality camera set.',0,'2020-11-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('iPhone 11','In September 2019, Apple officially launched a trio of iPhone 11 super products, in which the 64GB iPhone 11 version has the cheapest price but is still upgraded as strongly as the iPhone XR launched before.',0,'2019-09-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('iPhone XR','As an iPhone phone with a comfortable price, suitable for more customers, iPhone XR is still favored with a powerful Apple A12 chip, a notch screen and water resistance and dust resistance.',0,'2018-09-30',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('iPhone SE','iPhone SE 2020 when it was released has satisfied millions of Apple followers. The device has an ultra-compact design like the iPhone 8, the A13 Bionic chip for great performance like the iPhone 11, but the iPhone SE 2020 has an unexpectedly good price.',0,'2020-08-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Samsung Galaxy Z Fold3','A fully upgraded phone in many aspects, especially this is the world first folding screen phone with a hidden camera.',0,'2021-5-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Samsung Galaxy Z Fold2','Galaxy Z Fold 2 is the official name of Samsung high-end folding screen phone. With many pioneering upgrades in design, performance and camera, it promises to be the next successful super product from the world''s largest phone maker.',0,'2021-5-30',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Samsung Galaxy A22','Samsung welcomes the summer of 2021 with the launch of the Galaxy A22 and Galaxy A22 5G duo with many impressive parameters. In particular, Galaxy A22 owns a productive battery, strong gaming performance and a large screen with good display.',0,'2021-08-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Samsung Galaxy S21 Ultra 5G','The class is conveyed by Samsung through the Galaxy S21 Ultra 5G smartphone with a series of upgrades and improvements not only in external appearance but also in internal strength, promising to fully meet the increasing needs of people use.',0,'2021-08-20',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Samsung Galaxy Note 20','In August 2020, Galaxy Note 20 was officially on the shelves, with the familiar mole front camera design, novel rectangular camera cluster along with Samsung Exynos 990 processor that will surely bring a new experience.',0,'2020-08-30',3, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('OPPO Find X3 Pro 5G','OPPO has dominated the smartphone market with the launch of the OPPO Find X3 Pro 5G phone. This is a product with a unique design, possessing a huge camera cluster, top configuration in the Android world.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('OPPO Reno6 5G ','Not long after the launch of OPPO Reno5, OPPO has launched a new smartphone called OPPO Reno6 with a series of new improvements in both external appearance and internal performance, providing an outstanding user experience.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('OPPO A74','OPPO has always diversified its products from cheap to high-end. In particular, the OPPO A74 4G phone is located in the mid-range segment, which is remarkable with many features and the smartphone is also an upgrade of the previously launched OPPO A73.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('OPPO Reno5 5G','OPPO has launched the OPPO Reno5 5G version with super fast 5G internet connection to the market. The phone with a series of outstanding features and trendy appearance helps to enhance the luxury of the owner.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('OPPO Reno4 Pro','OPPO officially launched a smartphone called OPPO Reno4 Pro. The device is equipped with an extremely high-end configuration with Snapdragon 720G chip processor, an impressive set of 4 cameras up to 48 MP, and 65 W super fast charging technology.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Xiaomi Mi 11 5G','Xiaomi Mi 11 is a super product from Xiaomi, it offers top performance experience with Qualcomm Snapdragon 888 processor, and a series of top-notch technologies, making anyone overwhelmed about this smartphone.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Xiaomi Mi 10T Pro 5G','Mi 10T Pro 5G Xiaomi high-end smartphone model in 2020 was finally released with a series of "overwhelming" parameters: 144 Hz refresh rate screen, Snapdragon 865 processor and a huge 108 MP camera cluster with followed by a user-friendly price.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Xiaomi POCO X3 NFC','Xiaomi launched Xiaomi POCO X3 NFC with many attractive features on a smartphone, quality camera cluster, powerful performance, huge battery capacity and outstanding 33 W fast charging.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('The Pragmatic Programmer – Andy Hunt','The Pragmatic Programmer is the best illustrated book of the pitfalls and different aspects of software development.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('The Design of Everyday Things – Donald A. Norman','The content of the book talks about how design acts as an interface between the audience and the user and how to optimize for the best user experience.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Blockchain for Business','Written by three experts from IBM’s Enterprise Blockchain practice, this book educates readers on how to create, implement and operate blockchain-based solutions by providing them with practical steps. ',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('The Cybersecurity Playbook','With more than 60% of businesses reporting cyber attacks in 2019, there’s a clear need for firms to take steps to protect themselves and their customers from hackers.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Algorithms to Live By','Written by award-winning author Brian Christian and cognitive scientist Tom Griffiths, this book gives readers a fascinating insight into how computer algorithms can be applied in everyday life.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Hands-On Artificial Intelligence for Cybersecurity','As cyber attacks continue to become more frequent and complex, there’s increasing pressure on businesses to ensure they have the resources to identify and mitigate cyber crime.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Bio-Inspired Computing Models and Algorithms','Targeted at researchers, academics and professionals working in areas such as artificial intelligence, neural networks, theoretical computer science, bioinformatics and biocomputing.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Showstopper','Wall Street Journal reporter G. Pascal Zachary gives an inside look at how famed developer David Cutler and a team of software developers gave so much of their lives to create Windows NT.',0,'2019-08-20',4, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Noble Chair - Hero Series The Elder Scrolls Online Edition (ESO)','Hero Series The Elder Scrolls Online Edition (ESO) is one of our most advanced backrest-equipped gaming chairs with a larger, taller and wider surface.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Cougar Fusion Black','Gaming chair with good finish, high quality PVC leather, sturdy design. Help you easily relax, take a nap after a long work process thanks to the 180° reclining mechanism, sturdy aluminum frame, load-bearing up to 120 kg.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Cougar Fusion Orange','Gaming chair with good finish, high quality PVC leather, sturdy design. Help you easily relax, take a nap after a long work process thanks to the 180° reclining mechanism, sturdy aluminum frame, load-bearing up to 120 kg.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Warrior WGC102 Black','Whether you are focused on work or just want to relax. With the adjustable angle of the chair will help you in no time. With a recline angle of up to 135 degrees to help you rest and relax as well as sit up to 90 degrees if you want to work focused.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Warrior WGC102 Black Red','Whether you are focused on work or just want to relax. With the adjustable angle of the chair will help you in no time. With a recline angle of up to 135 degrees to help you rest and relax as well as sit up to 90 degrees if you want to work focused. The armrest will also adjust itself according to the tilt of the chair.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('E-Dra Mars EGC202 Black','It is too easy to own a gaming chair from E-Dra, you only have to spend less than 3 million to get yourself a fully functional gaming chair that lifts and lowers height, reclines 180 degrees, movable, full Full accessories and familiar design form.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Headphone DareU EH416 RGB','DareU EH416 RGB headphones with the main color tone are mysterious, glossy black, along with two large and thick ear buds that bring a strong but equally luxurious feeling. The product is also equipped with 16.8 million color LEDs (automatically changing colors). LEDs are arranged very reasonably on both sides of the headset with beautiful, bright white colors, including LED border and very prominent Logo.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Headphone Zidli ZH 7RB','We have a 7.1 sound simulation headset with good sound and high detail, a wide soundstage, easy to listen to and feel good for a long time thanks to the high-quality leather headband and earpads, comfortable wearing feeling without causing ear pain.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Headphone DareU EH469 7.1 RGB','DareU EH469 is a gaming headset that surely has no competition in the 500k price segment in terms of design. The large Oval-shaped earcup covers the ear, the headband can be stretched for a very comfortable wearing feeling. The frame of the headset is made of steel for high durability.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Headphone Rapoo VH520C','Rapoo VH520C headphones are equipped with LED breathing lights that change with different colors to make the headset stand out and eye-catching. With super durable materials, the VH520C has a sturdy and durable design when in use.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Headphone Mpow Air SE','Is a headset product line for gamers from the manufacturer Mpow. With a compact, lightweight design accompanied by 3D Surround Sound technology, promises to bring a great audio experience.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Headphone DareU EH925S 7.1 RGB','DareU EH925s are over-ear headphones, so the earcups are larger than many other types of headphones. The outside of the earcups are equipped with RGB LEDs with 16.8 million colors, a typical design of the gaming headset line. The ear cushions are manufactured with high-quality cushioning and leather-covered material, limiting peeling after a long time of use, and also creating a smooth feeling when worn for a long time.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mouse Logitech G102 Lightsync RGB Black','Despite its very affordable price, the Logitech G102 Lightsync RGB Mouse is equipped with 16.8 million RGB LEDs. Choose one color or mix 3 colors, available effects or create your own effects. The choice is yours ! You can also sync the mouse with other Logitech G LIGHTSYNC devices to make the camera angle more synchronized and unique.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mouse Logitech G402 Hyperion','Logitech G402 mouse possesses a scanning speed of up to 500 IPS, using Logitech latest sensor technology, Fusion Engine, for extremely high accuracy when used.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mouse Logitech G502 Hero','In addition to core performance and individual features, many details are designed and crafted with care. Logitech G502 Hero is one of the cheap gaming mouse lines compared to products in the same segment with braided cords with lace-up buttons with rough buckles, side handles with rubber edges, magnetic doors to the compartment for heavy blocks and many more. more.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mouse Razer Viper Mini','Born to push the very limits of ultra-lightweight gaming, the Razer Viper Mini takes up a smaller form that remains just as big in performance.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mouse Razer DeathAdder V2','With over 10 million Razer DeathAdder mice sold, this is the most popular and award-winning gaming mouse in the world for many years. Renowned for its distinctive ergonomic design. Perfect fit for palm form, and good support with claw or finger tip grip.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mouse Razer Basilisk V2','Having a large arsenal at your fingertips using your favorite macro buttons and secondary functions through Razer Synapse 3 software is one of the best gaming mice to buy today.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard Leopold FC980M PD Dark Yellow','Gaming keyboard products from the Leopold family always offer maximum simplicity in design and the Leopold FC980M PD Dark Yellow mechanical keyboard is no exception. With a shortened full-size design with 98 keys, wearing a mysterious black color and eye-catching golden characters for all eyes to look at the keyboard.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard Corsair K63 Wireless','The compact wireless keyboard model is solidly completed with a very fast key response speed thanks to a delay of only 1ms. Sophistication, simplicity and premium quality come from cherry switch. The keyboard is smooth, the pressure is moderate but still feels comfortable enough to use.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard Corsair K68 RGB','Now you can use the keyboard more comfortably because Corsair has equipped it with IP32 water and dust resistance. Accompany you all day long with IP32 rating that allows you to resist dust objects larger than 2.5mm and water poured directly from above (or at an angle of 15 degrees).',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard Razer Huntsman Mini Mercury','Razer Huntsman Mini is one of the low-cost mechanical keyboard product lines equipped with a type-C cable that helps ensure ruggedness, it helps to ensure that it remains securely connected while playing games and especially it. Can be easily disassembled for your convenience when traveling when using.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard Razer Blackwidow V3 Pro','The world first and most iconic Razer Blackwidow V3 Pro mechanical keyboard makes for a landmark development. Step into a new wireless meta with the Razer BlackWidow V3 Pro — with 3 connection modes offering unparalleled versatility and a satisfying gaming experience including best-in-class switches and full-height keys .',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard DareU EK1280 RGB','Beautiful keyboard design, good finishing quality. DareU with its tradition of cheap good products once again surprised us by their cheap gaming key model. The EK1280 RGB is truly a quality keyboard with the exclusive "D" switch from DareU. The bouncing, comfortable keys, high response speed and the ability to receive commands quickly are the advantages of this keyboard.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard DareU EK87 Pink White','DareU EK87 Pink White is one of the cheap mechanical keyboard models that perfectly meets the aesthetic. Featured with the Pink - White keycap set is very soothing to the eyes, combined with the Pink key cover with the same tone to give DareU EK87 Pink White an irresistible beauty.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard Logitech G913 TKL Lightspeed Wireless','The extremely prominent gaming keyboard with an ultra-thin floating switch design is unlike any mechanical keyboard model on the market today. The top is made of aluminum alloy and has a scratched finish to give the keyboard a luxurious look.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Keyboard Logitech G813 RGB','The Logitech G813 mechanical keyboard is crafted with high technology to provide a slim, refined appearance while maintaining the same functional performance. Durable, comfortable and always ready to fight any game. G813 is truly a keyboard of the future.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Screen Samsung LC34G55 34" 2K 165Hz FreeSync','Feel the breathless drama in every match you participate in with the ideal 1000R curved monitor. Quickly grasp the situation, master the game with optimally expanded vision and incredibly sharp images.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Screen LG 27GL850 UltraGear 27" Nano IPS 2K 144Hz 1ms HDR G-Sync','This monitor is aimed at demanding gamers who not only require an optimal screen for the game but also have to show beautiful frames. If you are this type of gamer then welcome to LG UltraGear 27" 2K.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Screen ASUS TUF GAMING VG259Q 25“ IPS 144Hz G-Sync 1ms','TUF Gaming VG259Q is a 24.5-inch, Full HD (1920x1080) IPS panel with 144Hz fast refresh rate designed for professional gamers and fast-paced gameplay. It also features 1ms MPRT response time and Adaptive-Sync technology for ultra-smooth gameplay, without tearing and stuttering.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Screen ViewSonic VX2458-P 24" 144Hz FreeSync','The ViewSonic® VX2458-P-mhd is an entertaining 24" gaming monitor with fast response times and gaming-powered features.With a 1ms (GtG) response time, the monitor delivers Great quality for gamers.Flexible connectivity via DisplayPort and three HDMI ports make connecting to other high-end graphics cards or peripherals for easy gaming.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Screen ASUS ProArt PA279CV 27“ IPS 4K','The ProArt Display PA279CV is a 27-inch monitor designed to meet the needs of content creation professionals, from photo and video editing to graphic design. ProArt Display PA279CV is color-balanced at the factory with Calman Verified certification to deliver excellent color accuracy (∆E < 2). Provides industry-standard 100% sRGB / 100% Rec. 709 color space coverage.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Screen LG 27UL850-W 27" IPS 4K FreeSync HDR','Born for imaging professionals, the LG 27UL850-W is one of a series of computer monitors that is not only a display device, but also presents the world in your eyes. With capabilities beyond what an ordinary designer might need, the LG 27UL850-W will certainly be the perfect choice for talented artists with discerning eyes.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Screen Dell UltraSharp U2422H 24" IPS','Extended connectivity easily connect your devices with comprehensive connectivity, including DP, HDMI, and super-speed 10Gbps USB. Quick-access ports on the front of the display allow convenient connection to peripherals and charge mobile phones with up to 15W of power via USB-C. Connect quickly with the super-fast 10Gbps USB port for allowing faster data transfer between the PC and the peripheral devices connected to the display.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mainboard Asus TUF GAMING B550M-PLUS (WI-FI) (Socket AM4)','The Asus TUF Gaming B550M (WI-FI) ZAKU II Edition motherboard is renowned for its beautiful, impressive looks inspired by the iconic MS-06S Char''s Zaku II. This motherboard model ensures the ability to make the most of the power of the CPU and video card.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mainboard Z490 GUNDAM','ASUS Z490-GUNDAM (WI-FI) is one of the latest motherboards from Asus. Inspired by the famous super robot series Gundam. This is considered one of the mainboard lines that bring a lot of creative inspiration for users to build a delicate and sharp PC system with its own imprint.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('Mainboard MSI MAG Z590 TORPEDO','MSI MAG Z590 TORPEDO is one of the latest Z590 mainboards from MSI with extremely high performance with comprehensive design, improving work efficiency, gaming entertainment and the need to customize the pc system according to your preferences.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('CPU AMD Ryzen 5 360 / 32MB / 4.2GHz / 6 cores 12 threads / AM4','AMD Ryzen 5 3600 CPU kit serves as a direct blow to Intel premium position of the Core i5-9600K. Possessing impressive parameters, 6 cores, 12 processing threads, up to 32MB of cache, and the most special thing is the maximum processing speed when operating in single-core mode up to 4.2GHz, which before no Ryzen CPUs can do this.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('CPU AMD Ryzen 5 3400G / 6MB / 4.2GHz / 4 cores 8 threads / AM4','The unlocked AMD Ryzen 5 3400G overclocks at 4.2GHz, 8% higher than the 2400G clocked at 3.9GHz. With 4 cores and 8 threads, at a base clock of 3.7GHz it easily handles office tasks and light esports gaming.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('CPU AMD Ryzen 5 3500X / 32MB / 4.1GHz / 6 cores 6 threads / AM4','The AMD Ryzen 5 3500x gives users a powerful processor performance from a base clock of 3.6GHz and turbo boost to 4.1GHz. You have 6 cores and 6 threads to keep all work and gaming tasks stable and smooth.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('(8GB DDR4 1x8G 2666) Ram Gigabyte Memory 2666','GIGABYTE memory is built on 10 layers of PCB, sophisticatedly designed to ensure the stability and high performance of selected Ics. GIGABYTE Memory heatsinks are simply designed to deliver the best performance. High-quality materials for better heat dissipation, ensuring memory stability.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('(8GB DDR4 1x8G 2666) RAM Kingston HyperX Fury Black','HyperX FURY DDR4 is the perfect choice for a system builder or someone looking for an upgrade to speed up their sluggish system. Our engineers have pre-built Intel Extreme Memory Profiles designed to maximize the performance of memory cards, reaching speeds up to 3733MHz.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('(8G DDR4 1x8G 2800) G.SKILL Ripjaws V','G.SKILL RIPJAWS V 8GB RAM is the latest addition to the classic Ripjaws series, the Ripjaws V series is the latest generation of DDR4 channel memory designed for maximum compatibility and outstanding performance with Intel® Core processors. ™.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('GIGABYTE AORUS GeForce RTX 3080 Ti XTREME 12G','Powerful performance enhancements with 10240 CUDA® Cores, Memory size up to 12GB and Memory Bandwidth up to 912 GB/s and PCI-E 4.0 x 16 platform ensure you handle all your graphics and computing tasks. perfectly entertained. Innovative cooling system with Max-Covered technology with unique BLADE STACK blade fan allows the video card system to operate at peak performance.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('ASUS ROG Strix LC GeForce RTX 3080 Ti OC Edition 12GB GDDR6X','ASUS ROG Strix LC GeForce RTX 3080 Ti OC Edition is a high-end video card that comes with a water cooler. ASUS ROG Strix LC GeForce RTX 3080 Ti OC Edition is a beautifully designed VGA card with a silver layer and RGB LED highlighting, ASUS ROG Strix LC GeForce RTX 3080 Ti OC Edition will highlight your computer case.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('MSI GeForce RTX 3080 Ti SUPRIM X 12G','MSI RTX 3080 Ti SUPRIM X 12G is one of MSI''s brand new Suprim series of graphics cards. Suprim is positioned as the most advanced line-up graphics card, so all of MSI''s quintessence is focused on this product. With the RTX 3080Ti core, playing games at 4K resolution on your computer screen has never been so easy.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('SSD Samsung 860 Evo 250GB 2.5" Sata 3 550/520 MB/s ( MZ-76E250BW )','The Samsung 860 EVO 250GB 2.5" SATA III SSD hard drive is upgraded from the previously very successful 850 EVO series.With read speed difference: 550MB/s /write: 520MB/s, Samsung 860 EVO 250GB 2.5" SATA III is Perfect choice for gamers, meeting the needs of gaming.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('SSD KINGSTON A2000 250GB M.2 NVMe - SA2000M8/250G','SSD KINGSTON A2000 250GB M.2 NVMe - SA2000M8/250G is the high-end M.2 SSD of the Kingston brand. Use a PCIe 3.0 x 4 connection with up to 32Gb/s bandwidth. Help KINGSTON A2000 250GB M.2 NVMe SSD - SA2000M8/250G has a pretty good operating speed, reaching a maximum of 2000MB/s for read speed and 1100MB/s for write speed. Surely this SSD will satisfy many users.',0,'2019-08-20',5, 1);
INSERT INTO Product(productName,description,rating,releaseDate,sellerID,status)VALUES ('SSD WD Blue SN550 250GB M.2 2280 NVMe Gen3 x4 (WDS250G2B0C)','If you are looking for an SSD that is compact, affordable and can let you boot the operating system, games, and software at breakneck speed, the SN550 will definitely be a good choice.',0,'2019-08-20',5, 1);
